import React from "react";
import TagList from "../data/TagList";

// This will handle displaying and adding new tags
// TagList will maintain the list of tags, as well as accept the new tags being added
class Tag extends React.Component {
  state = { newTag: "" }



  render() {
    return (
      <div>
        <div>
          <TagList />
        </div>

        <div class="ui right labeled left icon input">
          <i class="tags icon" />
          <input type="text" placeholder="Enter tags" />
          <a class="ui tag label">Add Tag</a>
        </div>
      </div>
    );
  }
}

export default Tag;
